USE graduate_db;

DROP TABLE IF EXISTS attached_files;
CREATE TABLE attached_files (
  id int(10) unsigned NOT NULL AUTO_INCREMENT PRIMARY KEY,
  file_name varchar(100) NOT NULL,
  extension VARCHAR(50) NOT NULL,
  link varchar(500) NOT NULL,
  author_id int(10) unsigned NOT NULL,
  message_id int(10) unsigned NOT NULL,
  date_of_publication date NOT NULL,
  json_data VARCHAR(1000)
);



CREATE TABLE extensions(
	name VARCHAR(20)
);		

UPDATE attached_files SET extension = (
	SELECT name FROM extensions ORDER BY RAND() LIMIT 1
);
DROP TABLE IF EXISTS extensions;

UPDATE attached_files SET link = (
	CONCAT("https://bankrot.fedresurs.ru/Download/file.fo?guid=",'"',file_name,extension,'"',"&type=MessageDocument")
);

UPDATE attached_files af SET json_data = (
	CONCAT('{"creator":',
		   '"',(SELECT CONCAT(bm.first_name, " ", bm.last_name) FROM bancrupcy_manager bm WHERE bm.id = af.author_id),'"',
		   ",",
		   '"',"phone",'"',":", 
		   '"',(SELECT bm.phone_number FROM bancrupcy_manager bm WHERE bm.id = af.author_id),'"',",",
			'"data":',
			'"',json_data,'"',
			"}")
);
	  
ALTER TABLE attached_files ADD COLUMN json_data_2 JSON;
UPDATE attached_files SET json_data_2 = JSON_PRETTY(json_data);
ALTER TABLE attached_files DROP COLUMN json_data;
ALTER TABLE attached_files RENAME COLUMN json_data_2 TO json_data;